(5, 1, 'Guru', 'Guru', '<p>–ò–¥–µ–∞–ª—å–Ω–æ –ø–æ–¥–æ–π–¥—ë—Ç –∫–∞–∫ –¥–ª—è –Ω–æ–≤–∏—á–∫–∞ —Ç–∞–∫ –∏ –¥–ª—è –æ–ø—ã—Ç–Ω–æ–≥–æ –º–∞—Å—Ç–µ—Ä–∞. –ë–ª–∞–≥–æ–¥–∞—Ä—è —Å–≤–æ–µ–π —É–Ω–∏–≤–µ—Ä—Å–∞–ª—å–Ω–æ—Å—Ç–∏, –∫–∞–∂–¥—ã–π –º–∞—Å—Ç–µ—Ä –Ω–∞–π–¥—ë—Ç —Å–≤–æ—é –ª—é–±–∏–º—É—é –Ω–∞—Å—Ç—Ä–æ–π–∫—É –¥–ª—è –∫–∞–∂–¥–æ–π –∑–æ–Ω—ã. –ù–∞ –∞–ø–ø–∞—Ä–∞—Ç–µ —Å—Ç–æ–∏—Ç –±–∞–∑–æ–≤—ã–π —ç–∫—Å—Ü–µ–Ω—Ç—Ä–∏–∫ —Å —Ö–æ–¥–æ–º 3,5 –º–º , –º—ã —Ä–µ–∫–æ–º–µ–Ω–¥—É–µ–º —ç—Ç—É –¥–ª–∏–Ω–Ω—É —Ö–æ–¥–∞ –¥–ª—è —Ä–∞–±–æ—Ç—ã –Ω–∞ —Å–∏—Å—Ç–µ–º–µ –∏–≥–ª–∞-–¥—é–∑–∞ (—á–µ—Ä–µ–∑ –ø–µ—Ä–µ—Ö–æ–¥–Ω–∏–∫ tattoohelper), –ø—Ä–∏ —Ç–∞–∫–æ–π –Ω–∞—Å—Ç—Ä–æ–π–∫–µ –∞–ø–ø–∞—Ä–∞—Ç–∞ –ø–æ–ª—É—á–∞–µ—Ç—Å—è –∫—Ä–∞—Å–∏–≤—ã–π –º—è–≥–∫–∏–π –ø–∏–∫—Å–µ–ª—å. –ï—Å–ª–∏ –ø–æ—Å—Ç–∞–≤–∏—Ç—å —ç–∫—Å—Ü–µ–Ω—Ç—Ä–∏–∫ —Å —Ö–æ–¥–æ–º 2,5 –º–º –∏ –ø–µ—Ä–µ—Ö–æ–¥–Ω–∏–∫ –ø–æ–¥ –º–æ–¥—É–ª—å , —Ç–æ–≥–¥–∞ –ø–æ–ª—É—á–∞–µ—Ç—Å—è –±—ã—Å—Ç—Ä—ã–π, –ø–ª–æ—Ç–Ω—ã–π –∏ –º—è–≥–∫–∏–π –ø—Ä–æ–∫—Ä–∞—Å. –¢–∞–∫–∂–µ –≤—ã –º–æ–∂–µ—Ç–µ —Å—Ç–∞–≤–∏—Ç—å —Ç–∞—Ç—É –∏–≥–ª—É, –Ω–∞ –ª—é–±–æ–π —ç–∫—Å—Ü–µ–Ω—Ç—Ä–∏–∫ ( 3,5 –∏–ª–∏ 2–º–º) –∏ –ø–æ–ª—É—á–∞—Ç—å –Ω–µ –º–µ–Ω–µ–µ –∫—Ä–∞—Å–∏–≤—ã–µ —Ä–∞–±–æ—Ç—ã.</p>', '<p>Ideal for both a beginner and an experienced craftsman. Thanks to its versatility, each master will find his favorite setting for each zone. The device has a basic eccentric with a stroke of 3.5 mm, we recommend this stroke length to work on the needle-nozzle system (via the tattoohelper adapter), with this setup of the device, a beautiful soft pixel is obtained. If you put an eccentric with a stroke of 2.5 mm and an adapter for the module, then you get a fast, dense and soft paint. You can also put a tattoo needle on any eccentric (3.5 or 2mm) and get no less beautiful work.</p>', '[\"public\\/images\\/categories\\/Guru 6420549791699.png\"]', '', '2023-03-26 17:20:07', '2023-03-26 17:20:07'),
(6, 1, 'Lovi', 'Lovi', '<p>–õ–µ–≥–µ–Ω–¥–∞—Ä–Ω—ã–π –∞–ø–ø–∞—Ä–∞—Ç, –∫–æ—Ç–æ—Ä—ã–π –Ω–∞–≤—Å–µ–≥–¥–∞ –ø–æ–∫–æ—Ä–∏–ª —Å–æ—Ç–Ω–∏ –º–∞—Å—Ç–µ—Ä–æ–≤ —Å–∞–º—ã–º–∏ –∫—Ä–∞—Å–∏–≤—ã–º–∏ –ø–∏–∫—Å–µ–ª—è–º–∏, –∞–ø–ø–∞—Ä–∞—Ç –∫–æ—Ç–æ—Ä—ã–π –ø—Ä–∏–Ω—ë—Å –º–Ω–æ–∂–µ—Å—Ç–≤–æ –∫—É–±–∫–æ–≤ –∑–∞ —Å–∞–º—ã–π –≤–æ–∑–¥—É—à–Ω—ã–µ –±—Ä–æ–≤–∏ –≤ —á–µ–º–ø–∏–æ–Ω–∞—Ç–∞—Ö. –î–∞! –ù–µ –æ–¥–∏–Ω –∞–ø–ø–∞—Ä–∞—Ç –Ω–µ –¥–∞—ë—Ç —Ç–∞–∫–æ–π –∫—Ä–∞—Å–∏–≤—ã–π –ø–∏–∫—Å–µ–ª—å –∫–∞–∫ –õ–æ–≤–∏! –ë–ª–∞–≥–æ–¥–∞—Ä—è –Ω–∞–ª–∏—á–∏—é 3 –Ω–∞—Å–∞–¥–æ–∫ –∂—ë—Å—Ç–∫–æ—Å—Ç–∏ , –≤—ã –º–æ–∂–µ—Ç–µ –Ω–∞—Å—Ç—Ä–æ–∏—Ç—å –º–∞—à–∏–Ω–∫—É –ø–æ–¥ –ª—é–±–æ–π —Ç–∏–ø –∫–æ–∂–∏ –∏ –∂–µ–ª–∞–µ–º—ã–π —É—Ä–æ–≤–µ–Ω—å –ø—Ä–æ–∫—Ä–∞—Å–∞. </p><p> –ê–ø–ø–∞—Ä–∞—Ç –ø—Ä–µ–¥–Ω–∞–∑–Ω–∞—á–µ–Ω –¥–ª—è —Ä–∞–±–æ—Ç—ã –Ω–∞ –∏–≥–ª–µ-–¥—é–∑–µ , —á–µ—Ä–µ–∑ –ø–µ—Ä–µ—Ö–æ–¥–Ω–∏–∫ tattoohelper. –•–æ–¥ –∏–≥–ª—ã 3,8 –º–º. –í–µ—Å 65 –≥—Ä. </p><p> –ú–æ—Ç–æ—Ä MAXON (–æ—Ä–∏–≥–∏–Ω–∞–ª) </p><p> –í –∫–æ–º–ø–ª–µ–∫—Ç–µ –º–∞—à–∏–Ω–∫–∞, —à–Ω—É—Ä –ø–∏—Ç–∞–Ω–∏—è, tattoohelper .</p>', '<p>The legendary device that forever conquered hundreds of masters with the most beautiful pixels, the device that brought many cups for the most airy eyebrows in the championships. Yes! Not one device does not give such a beautiful pixel as Catch! Thanks to the presence of 3 stiffeners, you can customize the machine for any type of skin and the desired level of procrastination.</p><p>The device is designed to work on a needle nozzle, through a tattoohelper adapter. The needle stroke is 3.8 mm. Weight 65 gr.</p><p>MAXON motor (original)</p><p>Included is a typewriter, power cord, tattoo helper.</p>', '[\"public\\/images\\/categories\\/Lovi 64205504c6cc7.png\"]', '', '2023-03-26 17:21:56', '2023-03-26 17:21:56'),
(7, 1, 'Fanatica', 'Fanatica', '<p>–†—É—á–∫–∞ –¥–ª—è —Ä–∞–±–æ—Ç—ã –º–æ–¥—É–ª—å–Ω—ã–º–∏ —Å–∏—Å—Ç–µ–º–∞–º–∏. –ù–µ –¥–ª—è –∫–æ–≥–æ –Ω–µ —Å–µ–∫—Ä–µ—Ç, —á—Ç–æ –º–æ–¥—É–ª—å–Ω–∞—è —Å–∏—Å—Ç–µ–º–∞ –≥–∞—Å–∏—Ç —Ö–ª—ë—Å—Ç–∫–æ—Å—Ç—å –ª—é–±–æ–≥–æ –º–æ–¥—É–ª—å–Ω–æ–≥–æ –∞–ø–ø–∞—Ä–∞—Ç–∞, –∏–∑-–∑–∞ –º–µ–º–±—Ä–∞–Ω—ã –∫–∞—Ä—Ç—Ä–∏–¥–∂–∞ , –∞ —Ç–∞–∫–∂–µ –∑–∞ —Å—á—ë—Ç –≤—Å—Ç—Ä–æ–µ–Ω–Ω–æ–π –≤ –∞–ø–ø–∞—Ä–∞—Ç –æ–±—Ä–∞—Ç–Ω–æ-–ø–æ—Å—Ç—É–ø–∞—Ç–µ–ª—å–Ω–æ–π –ø—Ä—É–∂–∏–Ω—ã . –í –º–∞—à–∏–Ω–∫–µ —Ñ–∞–Ω–∞—Ç–∏–∫–∞ , –º—ã —Å–º–æ–≥–ª–∏ –¥–æ–±–∏—Ç—å—Å—è –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–π –∏–º–∏—Ç–∞—Ü–∏–∏ —Ä–∞–±–æ—Ç—ã —Å–∏—Å—Ç–µ–º—ã –∏–≥–ª–∞-–¥—é–∑–∞, –∑–∞ —Å—á—ë—Ç —Ç–æ–≥–æ, —á—Ç–æ –Ω–µ —Å—Ç–∞–ª–∏ —Å—Ç–∞–≤–∏—Ç—å –ø—Ä—É–∂–∏–Ω—É, –¥–ª—è —Å–æ—Ö—Ä–∞–Ω–µ–Ω–∏—è —Å–∏–ª—ã —É–¥–∞—Ä–∞ , –≤–Ω—É—Ç—Ä–µ–Ω–Ω—é—é –∫–æ–Ω—Å—Ç—Ä—É–∫—Ü–∏—é —à–∞—Ç—É–Ω–∞ —É—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∞ –Ω–∞ –¥–≤—É—Ö –ø–æ–¥—à–∏–ø–Ω–∏–∫–∞—Ö, —á—Ç–æ –¥–∞—ë—Ç –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ –ª–µ–≥–∫–æ–µ —Å–∫–æ–ª—å–∂–µ–Ω–∏–µ, –∏ –∫–æ–Ω–µ—á–Ω–æ –∂–µ ,–º–æ—Ç–æ—Ä –ø—Ä–µ–º–∏—É–º –∫–ª–∞—Å—Å–∞ maxon DC max ,–∫–æ—Ç–æ—Ä—ã–π —Ç–∞–∫–∂–µ —Å—Ç–æ–∏—Ç –Ω–∞ –Ω–∞—à–µ–º —Ñ–ª–∞–≥–º–∞–Ω–µ Lovi.</p>', '<p>A handle for working with modular systems. It\'s no secret that the modular system dampens the lashing of any modular device, due to the cartridge membrane, as well as due to the back-and-forth spring built into the device. In the fanatic\'s typewriter, we were able to achieve maximum imitation of the needle-nozzle system, due to the fact that we did not put a spring to preserve the impact force, the internal structure of the connecting rod is mounted on two bearings, which gives the easiest possible sliding, and of course, the maxon DC max premium class motor, which also stands on our the flagship of Lovi.</p>', '[\"public\\/images\\/categories\\/Fanatica 642055667a134.png\"]', '', '2023-03-26 17:23:34', '2023-03-26 17:23:34'),
(8, 1, 'X-PRO ', 'X-PRO ', '<p>–ê–ø–ø–∞—Ä–∞—Ç X-PRO-–≥–∏–±—Ä–∏–¥–Ω—ã–π –∞–ø–ø–∞—Ä–∞—Ç –¥–ª—è —Ä–∞–±–æ—Ç—ã —Å–∏—Å—Ç–µ–º–∞–º–∏ –∏–≥–ª–∞-–¥—é–∑–∞ –∏ –∫–∞—Ä—Ç—Ä–∏–¥–∂.&nbsp;</p><p>–ê–ø–ø–∞—Ä–∞—Ç —Ä–∞–∑—Ä–∞–±–æ—Ç–∞–Ω –Ω–∞ –±–∞–∑–µ –ø–æ—Å–ª–µ–¥–Ω–µ–π –º–æ–¥–µ–ª–∏ –•–û–†–° .&nbsp;–ö–æ—Ç–æ—Ä—ã–π –∑–∞—Ä–µ–∫–æ–º–µ–Ω–¥–æ–≤–∞–ª —Å–µ–±—è –∫–∞–∫ —Ç–æ—á–Ω—ã–π, –ø—Ä–æ–¥—É–∫—Ç–∏–≤–Ω—ã–π, –±–µ–∑–≤–∏–±—Ä–∞—Ü–∏–æ–Ω–Ω—ã–π , –ª—ë–≥–∫–∏–π –∏ –∫—Ä–∞—Å–∏–≤—ã–π –∞–ø–ø–∞—Ä–∞—Ç .&nbsp;–ë–æ–ª—å—à–∏–Ω—Å—Ç–≤–æ –º–∞—Å—Ç–µ—Ä–æ–≤ –∏–º–µ–Ω–Ω–æ —Ç–∞–∫ –µ–≥–æ –æ—Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏–∑–æ–≤–∞–ª–∏!&nbsp;</p><p>–ú–æ–¥–µ–ª—å X-Pro&nbsp;—Å–æ—Ö—Ä–∞–Ω–∏–ª–∞ –≤ —Å–µ–±–µ –≤—Å–µ —ç—Ç–∏ —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏—Å—Ç–∏–∫–∏ , –∞ –≥–ª–∞–≤–Ω–æ–µ, –ø–æ –º–∞–∫—Å–∏–º—É–º—É , —Ä–∞—Å—à–∏—Ä–∏–ª–∞ —Å–≤–æ–π —Ñ—É–Ω–∫—Ü–∏–æ–Ω–∞–ª.&nbsp;–≠—Ç–æ—Ç –∞–ø–ø–∞—Ä–∞—Ç –ø–æ–ª–Ω–æ—Å—Ç—å—é –ø–µ—Ä–µ–∫—Ä—ã–≤–∞–µ—Ç –≤—Å–µ –ø–æ—Ç—Ä–µ–±–Ω–æ—Å—Ç–∏ —Å–æ–≤—Ä–µ–º–µ–Ω–Ω–æ–≥–æ –º–∞—Å—Ç–µ—Ä–∞ –ø–µ—Ä–º–∞–Ω–µ–Ω—Ç–Ω–æ–≥–æ –º–∞–∫–∏—è–∂–∞.</p>', '<p>–ê–ø–ø–∞—Ä–∞—Ç X-PRO-–≥–∏–±—Ä–∏–¥–Ω—ã–π –∞–ø–ø–∞—Ä–∞—Ç –¥–ª—è —Ä–∞–±–æ—Ç—ã —Å–∏—Å—Ç–µ–º–∞–º–∏ –∏–≥–ª–∞-–¥—é–∑–∞ –∏ –∫–∞—Ä—Ç—Ä–∏–¥–∂.&nbsp;</p><p>–ê–ø–ø–∞—Ä–∞—Ç —Ä–∞–∑—Ä–∞–±–æ—Ç–∞–Ω –Ω–∞ –±–∞–∑–µ –ø–æ—Å–ª–µ–¥–Ω–µ–π –º–æ–¥–µ–ª–∏ –•–û–†–° .&nbsp;–ö–æ—Ç–æ—Ä—ã–π –∑–∞—Ä–µ–∫–æ–º–µ–Ω–¥–æ–≤–∞–ª —Å–µ–±—è –∫–∞–∫ —Ç–æ—á–Ω—ã–π, –ø—Ä–æ–¥—É–∫—Ç–∏–≤–Ω—ã–π, –±–µ–∑–≤–∏–±—Ä–∞—Ü–∏–æ–Ω–Ω—ã–π , –ª—ë–≥–∫–∏–π –∏ –∫—Ä–∞—Å–∏–≤—ã–π –∞–ø–ø–∞—Ä–∞—Ç .&nbsp;–ë–æ–ª—å—à–∏–Ω—Å—Ç–≤–æ –º–∞—Å—Ç–µ—Ä–æ–≤ –∏–º–µ–Ω–Ω–æ —Ç–∞–∫ –µ–≥–æ –æ—Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏–∑–æ–≤–∞–ª–∏!&nbsp;</p><p>–ú–æ–¥–µ–ª—å X-Pro&nbsp;—Å–æ—Ö—Ä–∞–Ω–∏–ª–∞ –≤ —Å–µ–±–µ –≤—Å–µ —ç—Ç–∏ —Ö–∞—Ä–∞–∫—Ç–µ—Ä–∏—Å—Ç–∏–∫–∏ , –∞ –≥–ª–∞–≤–Ω–æ–µ, –ø–æ –º–∞–∫—Å–∏–º—É–º—É , —Ä–∞—Å—à–∏—Ä–∏–ª–∞ —Å–≤–æ–π —Ñ—É–Ω–∫—Ü–∏–æ–Ω–∞–ª.&nbsp;–≠—Ç–æ—Ç –∞–ø–ø–∞—Ä–∞—Ç –ø–æ–ª–Ω–æ—Å—Ç—å—é –ø–µ—Ä–µ–∫—Ä—ã–≤–∞–µ—Ç –≤—Å–µ –ø–æ—Ç—Ä–µ–±–Ω–æ—Å—Ç–∏ —Å–æ–≤—Ä–µ–º–µ–Ω–Ω–æ–≥–æ –º–∞—Å—Ç–µ—Ä–∞ –ø–µ—Ä–º–∞–Ω–µ–Ω—Ç–Ω–æ–≥–æ –º–∞–∫–∏—è–∂–∞.</p>', '[\"public\\/images\\/categories\\/X-PRO  6458d0c857a1f.png\"]', '<iframe src=\"https://www.youtube.com/emb