(2984, NULL, 'LouisresIP', 'Louisres', 'RU', 'TL', 'RU', '89765656669', 'avdotyyaactivist@yandex.ru', '', 'https://patriotbeton.ru/', '', 'Moscow', 'Moscow', '135115', '¬´–¢–µ—Ö—ç–∫—Å–ø–µ—Ä—Ç: –ë–∞–∑–æ–≤—ã–µ –Ω–æ—Ä–º–∞—Ç–∏–≤–Ω—ã–µ –¥–æ–∫—É–º–µ–Ω—Ç—ã¬ª –±–µ—Å–ø–ª–∞—Ç–Ω–æ –ü–æ–ø—Ä–æ–±–æ–≤–∞—Ç—å –±–µ—Å–ø–ª–∞—Ç–Ω–æ \r\n \r\n–ö–æ–Ω—Ç—Ä–æ–ª—å –∫–∞—á–µ—Å—Ç–≤–∞ –∑–∞—Ç–≤–µ—Ä–¥–µ–≤—à–µ–≥–æ –±–µ—Ç–æ–Ω–∞ –∑–∞–∫–ª—é—á–∞–µ—Ç—Å—è –≤ –æ–ø—Ä–µ–¥–µ–ª–µ–Ω–∏–∏ –ø—Ä–æ—á–Ω–æ—Å—Ç–∏ –≤–æ –≤—Ä–µ–º–µ–Ω–∏, ... \r\n \r\n–ù—É–∂–Ω–æ –ø–æ–¥–æ–±—Ä–∞—Ç—å —Å–æ—Å—Ç–∞–≤ –±–µ—Ç–æ–Ω–∞ —Ä–∞–≤–Ω—ã–º –æ–±—Ä–∞–∑–æ–º –ø—Ä–∏–≥–æ—Ç–æ–≤–∏—Ç—å –Ω–µ–æ–±—Ö–æ–¥–∏–º—É—é –±–µ—Ç–æ–Ω–Ω—É—é —Å–º–µ—Å—å, —Å–æ–±–ª—é–¥–∞—è —Ç–µ—Ö–Ω–æ–ª–æ–≥–∏—á–µ—Å–∫–∏–µ —Ç—Ä–µ–±–æ–≤–∞–Ω–∏—è. \r\n \r\n–ú—ã –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–ª—è–µ–º –≤—Å–µ –Ω–µ–æ–±—Ö–æ–¥–∏–º—ã–µ –¥–æ–∫—É–º–µ–Ω—Ç—ã: –¢–¢–ù, –ø–∞—Å–ø–æ—Ä—Ç –∫–∞—á–µ—Å—Ç–≤–∞ –≤—Å–µ–≥–¥–∞ –±–µ—Ç–æ–Ω, –≤—Å–µ —Å–µ—Ä—Ç–∏—Ñ–∏–∫–∞—Ç—ã –ø–µ—Ä–º–∞–Ω–µ–Ω—Ç–Ω–æ –≤—Ö–æ–¥—è—â—É—é –ø—Ä–æ–¥—É–∫—Ü–∏—é. \r\n \r\n–°–Ω–∞—á–∞–ª–∞ –ø—Ä–∏–≥–æ—Ç–∞–≤–ª–∏–≤–∞—é—Ç –∫–æ–º–ø–æ–Ω–µ–Ω—Ç—ã —Å–æ—Å—Ç–∞–≤–∞: –ø—Ä–æ–º—ã–≤–∞—é—Ç, –ø—Ä–æ—á–∏—â–∞—é—Ç –≤–¥–æ–±–∞–≤–æ–∫ –ø—Ä–æ—Å–µ–∏–≤–∞—é—Ç –ø–µ—Å–æ–∫ –∏ —â–µ–±–µ–Ω—å, —É–¥–∞–ª—è—é—Ç –≤–∑–≤–µ—Å–∏ –∏–∑ –≤–æ–¥—ã (–µ—Å–ª–∏ —Ç–∞–∫–æ–≤—ã–µ –∏–º–µ—é—Ç—Å—è). –ù–µ–¥–æ—Å—Ç–∞—Ç–æ—á–Ω–æ–µ –æ—á–∏—â–µ–Ω–∏–µ –∫–æ–º–ø–æ–Ω–µ–Ω—Ç–æ–≤ –ø—Ä–∏–≤–æ–¥–∏—Ç –∫ –ø—Ä–∏—Å—É—Ç—Å—Ç–≤–∏—é –≤ –±–µ—Ç–æ–Ω–µ –ø–æ—Å—Ç–æ—Ä–æ–Ω–Ω–∏—Ö –≤–µ—â–µ—Å—Ç–≤, –≤–ª–∏—è—é—â–∏—Ö –≤ –ª—é–±–æ–π –º–æ–º–µ–Ω—Ç –ø—Ä–æ—Ü–µ—Å—Å —Å—Ö–≤–∞—Ç—ã–≤–∞–Ω–∏—è, –¥–æ –≥—Ä–æ–±–∞ –ø–æ—Å–ª–µ–¥—É—é—â—É—é –ø—Ä–æ—á–Ω–æ—Å—Ç—å —Å–æ—Å—Ç–∞–≤–∞. \r\n[url=https://patriotbeton.ru/]–∫—É–ø–∏—Ç—å —Ç–æ–≤–∞—Ä–Ω—ã–π –±–µ—Ç–æ–Ω —Å –¥–æ—Å—Ç–∞–≤–∫–æ–π[/url] \r\n \r\n—Å–∫–æ–ª—å–∫–æ —Å–¥–µ–ª–∞—Ç—å –±–µ—Ç–æ–Ω: –≤ –∫–∞–∫–∏—Ö –ø—Ä–æ–ø–æ—Ä—Ü–∏—è—Ö –±–µ—Ä—É—Ç –∫–æ–º–ø–æ–Ω–µ–Ω—Ç—ã? \r\n \r\n–ß—Ç–æ–±—ã —É–ª—É—á—à–∏—Ç—å –∫–∞—á–µ—Å—Ç–≤–æ –±–µ—Ç–æ–Ω–∞, –≤ –Ω–µ–≥–æ –∏–Ω–æ–≥–¥–∞ –¥–æ–±–∞–≤–ª—è–µ—Ç—Å—è –∏–∑–≤–µ—Å—Ç—å. –í –Ω–∞—Å—Ç–æ—è—â–µ–µ –≤—Ä–µ–º—è –Ω–µ –≤–æ–∑–Ω–∏–∫–∞–µ—Ç –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ—Å—Ç–∏ –≤ –≥–∞—à–µ–Ω–∏–∏ –∏–∑–≤–µ—Å—Ç–∏, –Ω–∞–ø—Ä–∏–º–µ—Ä –¥–æ –∫–∞–∫–æ–π –º–µ—Ä–µ –≤ –ø—Ä–æ–¥–∞–∂–µ –∏–º–µ–µ—Ç—Å—è —Ä–∞–Ω–µ–µ –≥–∞—à–µ–Ω–∞—è (–≥–∏–¥—Ä–∞—Ç–Ω–∞—è) –∏–∑–≤–µ—Å—Ç—å, –∫–æ—Ç–æ—Ä–∞—è –ø—Ä–µ–¥—Å—Ç–∞–≤–ª–µ–Ω–∞ –≤ –≤–∏–¥–µ —Å—É—Ö–æ–π —Å–º–µ—Å–∏ –∏–ª–∏ –∏–∑–≤–µ—Å—Ç–∫–æ–≤–æ–≥–æ —Ç–µ—Å—Ç–∞. \r\n \r\n–ù–∞–º –≤–∞–∂–Ω–æ, —á—Ç–æ–±—ã –ø–æ—Å—Ç–∞–≤—â–∏–∫ –º–æ–≥ –±–µ–∑ —Ç—Ä—É–¥–∞ –≤—ã—É–¥–∏—Ç—å –≤ —Å–≤–æ–π —á–µ—Ä–µ–¥ –¥–æ—Å—Ç–∞–≤–∏—Ç—å –±–æ–ª—å—à–∏–µ –æ–±—ä–µ–º—ã –º–∞—Ç–µ—Ä–∏–∞–ª–∞, —Å –∫–æ–º–ø–∞–Ω–∏–µ–π –í–µ–ª–µ—Å–∞—Ä–∫ –Ω–∏–∫–∞–∫–∏—Ö –ø—Ä–æ–±–ª–µ–º –Ω–µ –≤–æ–∑–Ω–∏–∫–ª–æ. –ù–∞—à–∞ –∫–æ–º–ø–∞–Ω–∏—è —Ä–∞–±–æ—Ç–∞–µ—Ç –ø–æ —Å—Ä–µ–¥–Ω–∏–º –ø—Ä–æ–µ–∫—Ç–∞–º, –Ω–∞—á–∏–Ω–∞—è –æ—Ç —á–∞—Å—Ç–Ω–æ–≥–æ –¥–æ–º–æ—Å—Ç—Ä–æ–µ–Ω–∏—è —Ä–∞–≤–Ω—ã–º –æ–±—Ä–∞–∑–æ–º –∑–∞–∫–∞–Ω—á–∏–≤–∞—è —Å—Ç—Ä–æ–∏—Ç–µ–ª—å—Å—Ç–≤–æ–º —Å–∫–ª–∞–¥–æ–≤, –ø—Ä–æ–º—ã—à–ª–µ–Ω–Ω—ã—Ö –ø–ª–æ—â–∞–¥–æ–∫, –ø–∞—Ä–∫–æ–≤–æ–∫ –≤ —Å–≤–æ–π —á–µ—Ä–µ–¥ –¥—Ä—É–≥–æ–π –∏–Ω—Ñ—Ä–∞—Å—Ç—Ä—É–∫—Ç—É—Ä—ã. \r\n \r\n–¥–æ –≥—Ä–æ–±–∞ –ø–æ–≤–µ—Ä—Ö–Ω–æ—Å—Ç—å –∂–µ–ª–µ–∑–∞, –≤ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤–∏–∏ —Å –ø—Ä–∏–Ω—è—Ç—ã–º–∏ –ø—Ä–æ–ø–æ—Ä—Ü–∏—è–º–∏ –Ω–∞—Å—ã–ø–∞–µ—Ç—Å—è –ø–µ—Å–æ–∫, —â–µ–±–µ–Ω—å –≤ —Å–≤–æ–π —á–µ—Ä–µ–¥ —Ü–µ–º–µ–Ω—Ç. \r\n \r\n–¢–∞–∫ –∂–µ –≤ –ª—é–±–æ–π –º–æ–º–µ–Ω—Ç —Ü–µ–Ω—É –ë–°–ì –≤–ª–∏—è–µ—Ç –Ω–∞–ø–æ–ª–Ω–∏—Ç–µ–ª—å: –≥—Ä–∞–≤–∏–π, –≥—Ä–∞–Ω–∏—Ç, –∫–µ—Ä–∞–º–∑–∏—Ç. –û—Å–Ω–æ–≤–Ω—ã–µ –≤–∏–¥—ã –±–µ—Ç–æ–Ω–Ω—ã—Ö —Å–º–µ—Å–µ–π –∏–∑–≥–æ—Ç–∞–≤–ª–∏–≤–∞–µ–º—ã–µ –≤ –ª—é–±–æ–π –º–æ–º–µ–Ω—Ç –†–ë–£ –Ω–∞—à–µ–π –∫–æ–º–ø–∞–Ω–∏–∏: \r\n \r\n–º–∞—Ç—Ä–∏—Ü–∞ –ø—Ä–æ–ø–æ—Ä—Ü–∏–π –∫–æ–º–ø–æ–Ω–µ–Ω—Ç–æ–≤ —Ä–∞—Å—Ç–≤–æ—Ä–∞¬†–¥–ª—è —Ñ—É–Ω–¥–∞–º–µ–Ω—Ç–∞ –≤ –∑–∞–≤–∏—Å–∏–º–æ—Å—Ç–∏ –æ—Ç –º–∞—Ä–∫–∏ –±–µ—Ç–æ–Ω–∞. \r\n \r\n–ö–∞–∫ —Å–¥–µ–ª–∞—Ç—å –±–µ—Ç–æ–Ω –ö–ª–∞—Å—Å–∏—á–µ—Å–∫–∏–π —Å–æ—Å—Ç–∞–≤ –±–µ—Ç–æ–Ω–Ω–æ–π —Å–º–µ—Å–∏ —Å–æ—Å—Ç–æ–∏—Ç –∏–∑ —Ü–µ–º–µ–Ω—Ç–∞ –æ–ø—Ä–µ–¥–µ–ª–µ–Ω–Ω–æ–π –º–∞—Ä–∫–∏, –ø–æ–¥—Ö–æ–¥—è—â–µ–π –¥–ª—è –∫–æ–Ω–∫—Ä–µ—Ç–Ω–æ–≥–æ –≤–∏–¥–∞ —Ä–∞–±–æ—Ç, —Ä–µ—á–Ω–æ–≥–æ –ø–µ—Å–∫–∞, –≤–æ–¥—ã —Ç–∞–∫–∂–µ –ø—Ä–∏ –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ—Å—Ç–∏ —â–µ–±–Ω—è. –°–ª–µ–¥—É–µ—Ç –ø–æ–º–Ω–∏—Ç